import pandaLogo from './img/PandaLogo.png'

import Nav from './Nav'

function Header() {
    return (
        <header>
            <a href='/'>
                <img className='Logo' src={pandaLogo} alt='판다로고' />
            </a>
            <Nav />
        </header>
    );
}

export default Header;
